import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Arrowr from "@material-ui/icons/Input";

import styles from "assets/jss/material-kit-react/views/componentsSections/newsStyle.js";

import rudrawin from "assets/img/image/news/irc-prize.webp";

const useStyles = makeStyles(styles);

export default function SectionNews() {
    const classes = useStyles();

    return(<div>
        <div className={classes.container}>
            <div className={classes.section1}>
                <h1 className={classes.title}>NEWS</h1>
                <Arrowr className={classes.arrow} />
            </div>
            <div className={classes.section2}>
                <div className={classes.majornews}>
                    <img className={classes.imag1} src={rudrawin} height='100%' width='100%' />
                    <div className={classes.majoroverlay}>Indian Rover Challenge
                        Team RUDRA participated in the Indian Rover Challenge 2020 held at VIT (Chennai), and secured 3rd position 
                        globally and 1st position in Asia
                    </div>
                </div>
                {/* <div className={classes.news1}>

                </div> */}
                {/* <div className={classes.news2}>

                </div> */}
            </div>
        </div>
    </div>
    );
}
